**条目定义`Map.Entry`**
```Java
interface Entry<K, V> {
        // 获取条目的Key 
        K getKey();

        // 获取条目的值
        V getValue();

        // 设置条目的值
        V setValue(V value);

        // 比较两个条目是不是相等
