有三个类称为AtomicLongFieldUpdater，AtomicIntegerFieldUpdater和AtomicReferenceFieldUpdater，可用于使用反射以原子方式更新类的易失性字段。

要获得对这些类的对象的引用，您需要使用他们的工厂方法newUpdater()。

